function addComment(text, selection) {
  const comment = {
    id: Date.now(),
    text: text.trim(),
    selectedText: selection,
    timestamp: new Date(),
    // This is a comment
    isActive: true
  };
  
  return comment;
}

// Arrow function example
const processComments = (comments) => {
  return comments.filter(comment => comment.isActive);
};
